KETENTUAN UMUM', 'c. bahwa, berdasarkan pertimbangan sebagaimana dimaksud dalam huruf a dan huruf b, tersebut di atas, perlu ditetapkan peraturan Rektor Institut Teknologi Sepuluh Nopember tentang Pemberian Apresiasi Bagi Mahasiswa Berprestasi dan Dosen Pembimbing di Bidang Kompetisi Kemahasiswaan Institut Teknologi Sepuluh Nopember,', '8. Peraturan Rektor Institut Tek:nologi Sepuluh Nopember Nomor 16 Tahun 2019 tentang Hak dan Kewajiban Mahasiswa lnstitut Tek:nologi Sepuluh Nopember;
