10. Peraturan Rektor Institut Teknologi Sepuluh Nopember Nomor 26 Tahun 2019 tentang Organisasi dan Tata Kerja Sekretaris lnstitut, Direktorat, Biro, Kantor, Perpustakaan, dan Unit di Lingkungan Institut Teknologi Sepuluh Nopember sebagaimana telah diubah terakhir dengan Peraturan Rektor Institut Teknologi Sepuluh Nopember Nomor 22 Tahun 2022 tentang Perubahan Kedua Peraturan Rektor Institut Teknologi Sepuluh Nopember Nomor 26 Tahun 2019;']

